import React, { useState } from "react";
import styled from "styled-components";

function Projects(props) {
  return (
    <PortfolioWrapper>
      <form>
        <input
          placeholder="totally not a keylogger"
          style={{
            width: "130px",
            height: "30px",
            margin: "10px"
          }}
        />
      </form>
    </PortfolioWrapper>
  );
}

export default Projects;

const PortfolioWrapper = styled.div`
  width: 100vw;
  height: 100vh;
  background: black;
`;
